import React from 'react'

export default function GetSheduleNew() {
    const test = "1";
    fetch('https://mypew.ru/php/table.php', {
        method: 'POST',
        header: {
            "table": 3,
            "date" : "2022-04-11",
            "day_count" : 7,
            "type_sort" : "date"
        },
        body: JSON.stringify({action : 1})
    })
    .then (response)
  return (
    <div>
        {test}
    </div>
  )
}
